import React, { useEffect, useState } from 'react';
import {apiCall} from '../utils/apiCall'

function AdminPage() {

    const [users, setUsers] = useState([]);

    useEffect(()=>{
        getUsers();
    }, [])

    function getUsers(){
        apiCall("/user", 'get').then(res=>{
            console.log(res.data);
            setUsers(res.data)
        })
    }

    return (
        <div className='row'>
            <div className="container">
            <table className='table'>
                <thead>
                    <tr>
                        <th>t/r</th>
                        <th>fullName</th>
                        <th>username</th>
                        <th>email</th>
                        <th>enabled</th>
                        <th>roles</th>
                        <th>actions</th>
                    </tr>
                </thead>
                <tbody>
                    {
                        users.map(user=> <tr>
                            <td>{user.id}</td>
                            <td>{user.fullName}</td>
                            <td>{user.username}</td>
                            <td>{user.email}</td>
                            <td>{user.enabled}</td>
                            <td>
                                {
                                    user.roles.map(role=> <p>{role.name} <input type="checkbox" /></p>)
                                }
                            </td>
                        </tr>)
                    }
                </tbody>
            </table>
            </div>
        </div>
    );
}

export default AdminPage;
